import React from 'react'
import {useState, useEffect} from 'react'
import HomeCreatorCard from "./HomeCreatorCard"
import "./creatorCard.css"

function HomeCreatorList() {

    const [creators, setCreators] = useState([])

  useEffect(() => {
    fetch("http://localhost:9292/creators")
      .then((r) => r.json())
      .then((data) => setCreators(data));
  }, []);
  return (
    <div>
        {creators.map(creator => {
        return <HomeCreatorCard className="willywonka" key={creator.name} creator={creator} />
    })}
    </div>
  )
}

export default HomeCreatorList
